import React, { useState, useEffect } from "react";
import UseTable from "./hooks/useTable";
import { useNavigate } from 'react-router-dom'///use context
import axios from 'axios'
import { useAuth } from './auth'
function MyRecipes() {
    // const [parameters, setParameters] = useState()
    const navigate = useNavigate()
    const auth = useAuth()
    const handleLogout = () => {
        auth.logout()
        navigate('/')
    }
    const [table, setTable] = useState()
    useEffect(() => {
        console.log('inside useEffect Popular recipes')

        axios
            .get('http://localhost:3001/myRecipes?user')
            .then(res => {
                // console.log(res)
                setTable(res.data[0], auth.user)
            })
            .catch(err => {
                console.log(err)
            })
    }, [])
    return (
        <div className="profilePage">

               <div className="Popularrecipes">

                <h2>{auth.user}'s recipe book</h2>
            </div>

            <button onClick={() => navigate('/AddNewRecipe')}>Add new recipe on your book</button><br />
            <UseTable data={table}/>


        </div>
    )
}
export default MyRecipes
